e:1.375em\\\"><strong>II. Deep deformations of rocks</strong></span></span></p>\\n\\n<p><span style=\\\"font-size:1.375em\\\"><strong>Metamorphism</strong></span></p>\\n\"},\"subContentId\":\"b54ca27b-9919-428e-99aa-d08e629de1bc\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"},{\"x\":2.4752475247525,\"y\":73.351442659994,\"width\":94.925742574257,\"height\":26.161369193154,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\"><strong>Metamorphism </strong>occurs deep in the earth where rocks are being exposed to high temperature and pressure. </span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">Metamorphic rocks undergo structural changes that transform them into different types of rocks like schist, gneiss or marble. </span></p>\\n\"},\"subContentId\":\"ab6b903e-bb15-4eda-b56c-52b454429718\",\"metadata\":{\"contentType\":\"Text\",\"license\":\"U\",\"title\":\"Untitled Text\",\"authors\":[],\"changes\":[]}},\"alwaysDisplayComments\":false,\"backgroundOpacity\":0,\"displayAsButton\":false,\"buttonSize\":\"big\",\"goToSlideType\":\"specified\",\"invisible\":false,\"solution\":\"\"}],\"slideBackgroundSelector\":{\"fillSlideBackground\":\"#e8e6e7\"}},{\"elements\":[{\"x\":2.4752475247525,\"y\":53.789731051345,\"width\":95.049504950495,\"height\":38.630806845966,\"action\":{\"library\":\"H5P.AdvancedText 1.1\",\"params\":{\"text\":\"<p><span style=\\\"font-size:1.25em\\\">Metamorphic rocks are either foliated or non foliated rocks.</span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">Foliated: repetitive structure observed in metamporphic rocks, organized in parallel layers. </span></p>\\n\\n<p><span style=\\\"font-size:1.25em\\\">Non foliated: do not have a layered
